import React from 'react';

function RegisterPage() {
  return (
    <div>
      <form>
        <label>Example</label>
        <input name="example" defaultValue="test" />
        <label>ExampleRequired</label>
        <input name="exampleRequired" />
        <input type="submit" />
      </form>
    </div>
  );
}

export default RegisterPage;
